div.sphinxsidebar {
    width: 300px;
    /* background:#343131; */
}
div.sphinxsidebarwrapper {
    padding: 10px 5px 0 10px;
    position: relative;
}
div.bodywrapper {
    margin: 0 0 0 300px;
}

div.sphinxsidebar ul li {
    padding: 5px 0;
    list-style: none;

}
div.sphinxsidebar ul li a {
    /* color: #b3b3b3; */
    
}
div#sidebarbutton{
    display:none;
}

body,div.related,div.document {
    background: rgba(0,0,0,0.05);
}

div.body{
    color: #404040;
    background:#fcfcfc;
    padding:0;
}

div.body>div{
    padding:1.618em 3.236em;
}

body, div.body,div.body tt, div.body code, div.body pre, tt, code, pre  {

    font-family: "Lato","proxima-nova","Helvetica Neue",Arial,sans-serif;
    font-weight: normal;
}

div.body h1, div.body h2, div.body h3, div.body h4, div.body h5, div.body h6, div.body legend {

    margin-top: 0;
    font-weight: 700;
    font-family: "Roboto Slab","ff-tisa-web-pro","Georgia",Arial,sans-serif;
    background:#fcfcfc;

}

div.body h1 {

    font-size: 175%;

}

div.body a:hover {
    color: #3091d1;
}
div.body a:hover, div.body a:active {
    outline: 0;
}
div.body a {
    color: #2980B9;
    text-decoration: none;
    cursor: pointer;
}

